CREATE DATABASE Sistema_BioGen;
GO
USE Sistema_BioGen;
GO
 
 
CREATE TABLE beneficiario (
    id_beneficiario INT IDENTITY(1,1) PRIMARY KEY,
    nis VARCHAR(11) NOT NULL UNIQUE,
    cpf VARCHAR(11) NOT NULL UNIQUE,
    nome_completo VARCHAR(100) NOT NULL,
    endereco VARCHAR(80) NOT NULL
);
 
 
CREATE TABLE acesso_log (
    id_log INT IDENTITY(1,1) PRIMARY KEY,
    user_login VARCHAR(50) NOT NULL,
    senha VARCHAR(255) NOT NULL,
    data_acesso DATETIME DEFAULT GETDATE()
);
 
 
CREATE TABLE administrador (
    id_admin INT IDENTITY(1,1) PRIMARY KEY,
    Adm_login VARCHAR(50) NOT NULL UNIQUE,
    senha VARCHAR(255) NOT NULL
);
 
 
CREATE TABLE fornecedor (
    id_fornecedor INT IDENTITY(1,1) PRIMARY KEY,
    cnpj VARCHAR(19) NOT NULL UNIQUE,
    endereco TEXT NOT NULL,
    nome VARCHAR(100) NOT NULL,
    nome_empresa VARCHAR(100) NOT NULL,
    razao_social VARCHAR(100) NOT NULL,
    email VARCHAR(100) NOT NULL UNIQUE,
    senha VARCHAR(255) NOT NULL
);
 

CREATE TABLE operacao_fornecedor (
    id_operacao INT IDENTITY(1,1) PRIMARY KEY,
    id_fornecedor INT,
    ton_processadas DECIMAL(10,2),
    impostos_abatidos DECIMAL(10,2),
    qtd_energia_gerada DECIMAL(10,2),
    data_operacao DATETIME DEFAULT GETDATE(),
    FOREIGN KEY (id_fornecedor) REFERENCES fornecedor(id_fornecedor)
);
 
 
 
 
 
 
 
 
 


 
 
 
SELECT * FROM beneficiario;
 
SELECT * FROM fornecedor;
 
 
SELECT nome_completo, cpf FROM beneficiario;
 
 
SELECT nome_empresa, cnpj, email FROM fornecedor;
 
 
SELECT * FROM beneficiario WHERE nome_completo LIKE 'João%';
 
SELECT * FROM operacao_fornecedor WHERE ton_processadas > 180;
 
 
SELECT * FROM fornecedor ORDER BY nome_empresa ASC;
 
SELECT * FROM operacao_fornecedor ORDER BY data_operacao DESC;
 
 
-- Usando JOIN para relacionar tabelas
SELECT f.nome_empresa, o.ton_processadas, o.data_operacao
FROM fornecedor f
INNER JOIN operacao_fornecedor o ON f.id_fornecedor = o.id_fornecedor;



